import React from "react";

const DiaryItem = ({ id, emotion, content, date, img }) => {
  const strDate = new Date(parseInt(date)).toLocaleDateString();

  return (
    <div className="DiaryItem">
      <div
        className={["emotion_img_wrapper", `emotion_img_wrapper_${emotion}`].join(" ")}
      >
        <img className={`img_${emotion}`} src={process.env.PUBLIC_URL + `assets/emotion${emotion}.png`} />
      </div>
      <div className="info_wrapper">
        <div className="diary_date">{strDate}</div>
        <div className="diary_conent_preview"></div>
      </div>
      <div className=""></div>
    </div>
  );
};

export default DiaryItem;
